    const myConstant = {
        //Regular Expression
        GET_URL : /(https?:\/\/[^\s]+)/g,
        GET_TEXT : /`(.*?)`/,
//Variable constant
        CONTACT: "Contact the developer",
        TERMS : "Terms of service",
        CANCEL:"Cancel",
        TRY:"Try it out"
    }
    export default myConstant;
